import React from 'react';
import style from './navbar.module.css';
import logo from '../../../images/navbar/logo.png';

import { Link } from 'react-router-dom';

export default function Navbar() {
  return (
    <nav className={style.nav}>
      <img className={style.img} src={logo} alt='logo' width='100' lang='100' />
      <Link to='/adminHome' className={style.link}>
        Home
      </Link>
      <Link to='/userAdmin' className={style.link}>
        User Data
      </Link>
      <Link to='/userReports' className={style.link}>
        Users Reports
      </Link>
      
      <Link to='/addComponents' className={style.link}>
        Add Components
      </Link>

      <Link to='/addAssemblies' className={style.link}>
        Add Assemblies
      </Link>

      <Link to='/userHome' className={style.link}>
        Front End
      </Link>
    </nav>
  );
}
